} Code Explanation #if some_condition is called Conditional Compiling expression, here, our code will only be compiled to Krom platform. We define structure and convert the structure into json. We get Krom's file location (during playing from armory, krom's file location is root_folder/build_file/debug/krom/save_game.json) and append our save_game.json to the path. Convert our stringy json to bytes. Save data from bytes to path specified. Now, if you play the game and go over to root_folder/build_file/debug/krom/ you should find save_game.json and on opening it should read {"text":"Hello World!"}, if you do, then Congratulation! You did it! Let save save_game.json to proper place and add some keyboard input code to handle saving manually instead of saving when the game initiate. SaveLoadMechanism.hx package arm;
