To view around our scene's environment, we will use arcball camera rotation. Now, arcball rotation is rotation of an object around a point . We will arcball rotate the camera when right mouse button is pressed and hold and use mouse wheel to zoom in and out. To do so: Create an empty CameraEmpty and position it to center of world and then set parent of our camera to this empty. Create new haxe trait CameraController and assign it to our camera, we will use this to control behavior of our camera. CameraController.hx package arm; import iron.Scene;
import iron.system.Input;
import iron.math.Vec4; class CameraController extends iron.Trait { //Get our CameraEmpty var cameraEmpty = Scene.active.getEmpty("CameraEmpty").transform; //Get mouse var mouse = Input.getMouse(); @prop var viewMin = 1.0; @prop var viewMax = 2.8; public function new() { super(); notifyOnUpdate(update); } function update() { if(mouse.down("right")){ // Rotate our empty on z-axis in opposite direction of our mouse-x movement. // Mouse movement is divided by 200 to slow the rotation. cameraEmpty.rotate(new Vec4(0, 0, 1), -mouse.movementX / 200); cameraEmpty.buildMatrix(); cameraEmpty.rotate(object.transform.world.right(), -mouse.movementY / 200); cameraEmpty.buildMatrix(); } if (mouse.wheelDelta != 0){ //Add mouse wheel delta to cameraEmpty scale cameraEmpty.scale.add(new Vec4(mouse.wheelDelta/30, mouse.wheelDelta/30, mouse.wheelDelta/30)); //Clamp the scale cameraEmpty.scale.clamp(viewMin, viewMax); cameraEmpty.buildMatrix(); } }
} Code Explanation @prop, is used for variable that need configuration, if you refresh script than you can edit this variable straight from blender. We get empty's transform and and set it z-axis rotation to reverse of our mouse moment on x-axis and slow it down by 200, and then buildMatrix(). We rotate our empty again but on object's right location in world-space and with our mouse's moment on y-axis and again call buildMatrix(). If mouse's wheel is moving, than add mouse's wheel delta to cameraEmpty's scale and slow it down by 30, thus adding zoom in and out. Clamp the scale between viewMin and viewMax, so that camera can't zoom in and out more. You should get this: Some Image

