We will interact with our building by selecting, unselecting building. To do so, We will physics ray-cast to group 2(groups of buildings) and check if it hit any of our building, if it do than set selected building to this. BuildingController.hx import armory.trait.physics.PhysicsWorld; import iron.Scene;
import iron.math.Vec4;
import iron.math.RayCaster;
import iron.system.Input; //Define structure of building
typedef Building = { name: String, type: Int
} class BuildingController extends iron.Trait { //Declare selectedBuilding, i.e., name of building currently selected. public static var selectedBuilding:Building = null; //Whether any building is selected or not public static var isBuildingSelected = false; public function new() { super(); } public static function raySelectBuilding() { //Get rigid body from raycast from group 2. var rigidbody = getRaycast(2).rigidbody; //Check if rigidbody isn't null and rigidbody's name start with "bld" if(rigidbody != null && StringTools.startsWith(rigidbody.object.name, "bld")){ //Set selected building to hit rigidbody name selectedBuilding = getBuildingFromString(rigidbody.object.name); isBuildingSelected = true; }else { selectedBuilding = null; isBuildingSelected = false; } } static function getRaycast(group:Int){ var physics = PhysicsWorld.active; var mouse = Input.getMouse(); var start = new Vec4(); var end = new Vec4(); var camera = Scene.active.getCamera("Camera"); // Get Ray-cast direction from start to end with mouse's x, y and camera RayCaster.getDirection(start, end, mouse.x, mouse.y, camera); // cast ray from camera's location in world space to end vec and get hit result. var hit = physics.rayCast(camera.transform.world.getLoc(), end, group); var rigidbody = (hit != null) ? hit.rb : null; //wrap rigidbody and hit result and return it. return{ rigidbody: rigidbody, hit: hit }; } static function getBuildingFromString(name: String):Building { var building:Building = null; for(i in buildings){ if (i.name == name) building = i; } return building; } } Code Explanation We define data structure of our building, that is its name and it type, with this it will be a lot easier to manage buildings(add, remove, etc). We create getBuildingFromString(*name*), we loop through all building and check if name match building's name, if so, return the building object. We create getRaycast(*group*) specially, as we don't want to repeat this function during selecting and moving of building. This will ray-cast for specific group from camera to mouse's x/y location in world space, and get hit and rigidbody. We create raySelectBuilding(), which will be use to ofc selected building, we will do so why using our getRaycast() and get rigidbody of hit object, if this rigidbody's name start with 'bld' then set selectedBuilding to this rigidbody name and set isBuildingSelected to true else, null and false.

