To be able to place building, we will first unselect any selected building, spawn new building and set selected building to new spawned one. To place it we will simply unselect our selected building. To remove building, we will select the building, than remove the building and then unselect building. BuildingController.hx import iron.object.Object;
~
typedef Building = { ~ } class BuildingController extends iron.Trait { ~ //Declare arrays of buildings public static var buildings: Array<Building> = []; //Building's Id, eg: bld_hs1, bld_pw2, etc. public static var buildingId = 0; public function new() { ~ } public static function raySelectBuilding() { ~ } public static function moveBuilding() { ~ } public static function selectBuilding(name: String) { selectedBuilding = getBuildingFromString(name); isBuildingSelected = true; buildingMove = true; } public static function unselectBuilding() { selectedBuilding = null; isBuildingSelected = false; buildingMove = false; } public static function spawnBuilding(type: Int) { unselectBuilding(); //Spawn object with name = "bld_"+type Scene.active.spawnObject("bld_"+type, null, function(bld: Object){ //Increment buildingID buildingId++; //Change name bld.name = "bld_"+type+"_"+buildingId; //Add new building to add with name and type buildings.push({ name: "bld_"+type+"_"+buildingId, type: type }); selectBuilding(bld.name); }); } public static function removeBuilding() { //Remove Selected building Scene.active.getChild(selectedBuilding.name).remove(); //Remove selected building from buildings array removefromArray(selectedBuilding.name, buildings); //Unselect building unselectBuilding(); } static function getRaycast(group:Int){ ~ } static function getBuildingFromString(name: String):Building { ~ } static function removefromArray(name: String, buildings: Array<Building>){ //Define building and set it to null var building:Building = null; //loop through buildings array for (i in buildings){ //if building's name match, with name parameter if (i.name == name){ //Set above declared building to this building = i; } } //Get index of building in buildings array var index = buildings.indexOf(building); //If it exist(doesn't exist = -1) if (index > -1){ //remove building from array from index and length buildings.splice(index, 1); } }
} Code Explanation We creates selectBuilding(*name*) and we do so by setting selectedBuilding to name , isBuildingSelected to true, and buildingMove to true. We creates unselectBuilding() and we do so by setting selectedBuilding, isBuildingSelected to null, false respectively. We will now spawn building with spawnBuilding(*type*), we will first spawn object and when it is spawned, we will increment buildingId, set it name to "bld_"+its type+ its buildingId, pushes this building to our buildings array and unselect any selected building and select this spawned building. We will create a utility function removefromArray(*name*, *buildings*) to remove selectedBuilding from buildings array. we will loop through buildings array check if name matches, if it do then get index of this building in buildings array and then remove it with splice. Now to remove building, we will create removeBuilding(), with it we will remove building object from game and then remove it from out buildings array and finally unselect building.

